import React, { Component } from 'react';

class RightSideBar extends Component {
    render() {
        return (
            <div className="right-bar">
                <h5>Validate for correct email format</h5>
                <h5>Mobile number maxlength 10</h5>
                <h5>Step Counter {this.props.count}/4</h5>
                <h5>Progress {this.props.count*25}%</h5>
            </div>
        )
    }
}

export default RightSideBar
